    temp = 0
    r = int(a[0])-temp

    for i in a:
        if int(i)-temp !=r:
            return -1
        temp = int(i)
    b = int(a[-1]) 
    return b+r

def B(a):
    temp = 1
    r = int(a[0])/temp

    for i in a:
        if int(i)/temp !=r:
            return -1
        temp = int(i)
    b = int(a[-1])    
    return int(b*r)


